static 
void gobble_string(char which)
{

  int bslash = 0;
  char c;
  while ((c = input()) && c != -1)
  {

    perllexreal_column++;
    switch(c)  {

      case '\\':
                 if (!bslash)
                   bslash = 1;
                 else
                   bslash = 0;
                 break;
      case '\n':
                 perllexreal_column = 0;
                 perllex_column = 0;
                 perllex_lineno++;
                 bslash = 0;
                 break;
      default:
                 if (c == which && !bslash)  {
                   return;
                 }
                 bslash = 0;
                 break;
    }
  }
}



static 
void gobble_pod(void)
{

  int bline = 0;
  int cstate = 0;
  char c;
  while ((c = input()) && c != -1)
  {
    perllexreal_column++;
    switch(c)  {
    
      case '=':
                if (!bline)
                  cstate = 1;
                break;
      case '\n':
                 perllexreal_column = 0;
                 perllex_column = 0;
                 perllex_lineno++;
                 
                 bline = 0;
                 if (cstate == 4)
                   return;
                 break;
      case 'c': 
                 if (cstate == 1)
                   cstate = 2;
                 break;
      case 'u':  if (cstate == 2)
                   cstate = 3;
                 break;
      case 't':  if (cstate == 3)
                   cstate = 4;
                 break;
      case ' ':
      case '\t':
                 if (cstate == 4)
                   return;
                 break; 
      default:
                 bline++;
                 cstate = 0;
                 break;
    }
  }
}

    

    
